import { observable } from "mobx";

const testStore = observable({
  // state
  pitchers: [],
  bullpens: [],

  // action
  addPitchers(list) {
    this.pitchers = [...this.pitchers, ...list];
  },

  removeBullpens(seq) {
    this.bullpens = this.bullpens.filter((item) => {
      return item.pitcherSeq !== seq;
    });
  },
});

export default testStore;
